import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'


function App() {
  const columns = [
    {
      key: "john",
      value: "John Doe",
    },
    {
      key: "jane",
      value: "Jane Doe",
    },
    {
      key: "mary",
      value: "Mary Phillips",
    },
    {
      key: "robert",
      value: "Robert",
    },
    {
      key: "karius",
      value: "Karius",
    },
  ];

  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <ReactSearchBox
        placeholder="Placeholder"
        value="Doe"
        data={columns}
        callback={(record) => console.log(record)}
      />

      <p className="helloWorld">
        Hello World
      </p>


    </div>


  );
}

export default App;
